import './index.css'

const App = () => {

const [back , setback] = useState();

const Change_Back=()=>{
  setback(!back)
}



  return (
    <div className='main'>

<div className={back ? "sub_main" : "green"}>

<h3 className='heading'>
  Click OnThe Button To Change Background

</h3>

<button
 className='button_style'
 onClick={()=>{Change_Back()}}
> Click Here !</button>

</div>
    </div>
  )
}

export default App
